using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// A UIPrinterPickerController object displays the system interface for selecting a printer. You can use a printer picker controller to display a list of printers to the user prior to printing a document, photo, or other content. Printer pickers display all pickers normally but you can filter out printers by assigning an appropriate delegate object to the picker before displaying it.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIPrinterPickerController_class/index.html#//apple_ref/occ/cl/UIPrinterPickerController"/>    [iOSVersion(8)]    [Export("")]    public class UIPrinterPickerController : NSObject//, AnyObject, CVarArgType, Equatable, Hashable, NSObjectProtocol, Printable    {        public UIPrinterPickerController() { }        /// <summary>        /// Presents the picker from a view controller of your app.        /// </summary>        /// <param name="animated">true to animate the display of the picker or false to display it without animations.</param>        /// <param name="completionHandler">A block to execute when the picker is dismissed. Use this block to receive information about the selected printer or information about any errors that occurred.</param>        [iOSVersion(8)]        [Export("presentAnimated")]        public virtual bool PresentAnimated(bool animated, [Optional] UIPrinterPickerCompletionHandler completionHandler) { return default(bool); }                /// <summary>        /// Present the picker in a popover that is anchored to the specified bar button item.        /// </summary>        /// <param name="item">The bar button item to use as the anchor for the popover.</param>        /// <param name="animated">true to animate the display of the picker or false to display it without animations.</param>        /// <param name="completionHandler">A block to execute when the picker is dismissed. Use this block to receive information about the selected printer or information about any errors that occurred.</param>        [iOSVersion(8)]        [Export("presentFromBarButtonItem")]        public virtual bool PresentFromBarButtonItem([Unwrapped] UIBarButtonItem item, bool animated, [Optional] UIPrinterPickerCompletionHandler completionHandler) { return default(bool); }                /// <summary>        /// Present the picker in a popover that is anchored to a rectangle in the specified view.        /// </summary>        /// <param name="rect">The rectangle to which to anchor the popover. Specify the rectangle using the coordinate system of the view in the view parameter.</param>        /// <param name="inView">The view containing the specified rectangle.</param>        /// <param name="animated">true to animate the display of the picker or false to display it without animations.</param>        /// <param name="completionHandler">A block to execute when the picker is dismissed. Use this block to receive information about the selected printer or information about any errors that occurred.</param>        [iOSVersion(8)]        [Export("presentFromRect")]        public virtual bool PresentFromRect(CGRect rect, [Unwrapped] UIView inView, bool animated, [Unwrapped] UIPrinterPickerCompletionHandler completionHandler) { return default(bool); }                /// <summary>        /// Dismiss the picker.        /// </summary>        /// <param name="animated">true to animate the dismissal of the picker or false to remove it without animations.</param>        [iOSVersion(8)]        [Export("dismissAnimated")]        public virtual void DismissAnimated(bool animated) {  }                /// <summary>        /// The delegate for the printer picker controller.        /// </summary>        [iOSVersion(8)]        [Export("delegate")]        [Optional]        public UIPrinterPickerControllerDelegate Delegate { get; set; }                /// <summary>        /// The selected printer. (read-only)        /// </summary>        [iOSVersion(8)]        [Export("selectedPrinter")]        [Optional]        public UIPrinter SelectedPrinter { get; private set; }    }    /// <summary>    /// The completion handler to execute when dismissing a printer picker controller.    /// </summary>    [iOSVersion(8)]    public struct UIPrinterPickerCompletionHandler    {        static public implicit operator UIPrinterPickerCompletionHandler(Action<UIPrinterPickerController, bool, NSError> value)        {            return default(UIPrinterPickerCompletionHandler);        }        static public implicit operator Action<UIPrinterPickerController, bool, NSError>(UIPrinterPickerCompletionHandler value)        {            return default(Action<UIPrinterPickerController, bool, NSError>);        }    }}